import React, { Component } from 'react';
import '../../App.css';
import Forms from '../Forms/formComponent';
import Table from '../Table/tableComponent';
import MainPage from '../Pages/MainPage/mainpage';
import {Route} from 'react-router-dom';

class Header extends Component {
    render() {

      return (
        <header id="home" className="Header">
        <nav id="nav-wrap">
           <ul id="nav" className="nav">
           <li className="current"><a className="smoothscroll" href="/home">CompanyLogo</a></li>
              <li className="current"><a className="smoothscroll" href="/home">Home</a></li>
              <li><a className="smoothscroll" href="/forms">Forms</a></li>
               <li><a className="smoothscroll" href="/table">Table</a></li>
              <li><a className="smoothscroll" href="/portfolio">Menu1</a></li>
           </ul>
        </nav>
        <div className="pages">

        </div>
        <Route path="/" render={()=> <h1>jdhfkjds</h1>}/>
        <MainPage></MainPage>
     </header>
      );
    }
  }

  export default Header;
